import * as React from 'react';

import './Home.css';
import Courses from "../components/Cards";
import Navbar from "../components/Navbar"

import { Link } from 'react-router-dom';
import './styles.css';

function Home (){
    return(
        <>
            <Navbar/>
            <div className="sidebar">
      <Link to="/">Inicio</Link>
      <Link to="/gestion-turnos">Gestión de turnos</Link>
      <Link to="/gestion-pacientes">Gestión de pacientes</Link>
      <Link to="/gestion-personal-salud">Gestión personal de la salud</Link>
      <Link to="/configuracion-agenda-recursos">Configuración agenda recursos</Link>
      <Link to="/gestion-reportes">Gestión de reportes</Link>
      <Link to="/recepcion-pacientes">Recepción de pacientes</Link>
      <Link to="/configuracion-general">Configuración general</Link>
      <Link to="/agenda-medica">Agenda médica</Link>
      <Link to="/gestion-totem">Gestión de totem</Link>
      <Link to="/farmacia-central">Farmacia central</Link>
    </div>
            <Courses/>
        </>
    )
}

export default Home;
